import React from 'react'

export default class Component extends React.Component {
    constructor(props) {
        super(props);

        if (! props.pageLoaded) {
            props.loadPage();
        }
    }

    componentWillReceiveProps(props) {
        if (! props.pageLoaded) {
            props.loadPage();
        }
    }

    render() {
        if (this.props.pageLoaded === false) {
            return this.jsxNotLoaded();
        }

        return (
            <div dangerouslySetInnerHTML={{__html: this.props.pageHtml}} />
        );
    }

    jsxNotLoaded() {
        return (
            <div>
                <img width="40px" height="40px" src="data:image/gif;base64," />
            </div>
        );
    }
};
